import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image, ActivityIndicator } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Image
        source={require('/assets/fuel_logo.png')}
        style={styles.image}
      />
      <Text style={styles.title}>
        <Text style={styles.fuelWord}>Fuel</Text>
        <Text style={styles.finderWord}>Finder</Text>
      </Text>
      <Text style={styles.additionalText}>
        Your additional text here
      </Text>
      <ActivityIndicator size="large" color="#0000ff" />
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'flex-start', // Vertically align content at the top
    paddingTop: 20, // Add padding to the top
  },

  image: {
    width: 200,
    height: 200,
    resizeMode: 'contain', // Adjust the resizeMode as needed
  },

  title: {
    fontSize: 24, // You can adjust the font size as needed
    textAlign: 'center', // Center the text horizontally
    marginTop: 10, // Add margin at the top
  },

  fuelWord: {
    fontWeight: 'bold',
    color: 'rgb(8,8,8)',
  },

  finderWord: {
    color: 'rgb(33,33,33)',
  },

  additionalText: {
    fontSize: 16,
    textAlign: 'center',
    marginVertical: 10,
  },
});
